import React, { Component } from 'react'
import MainTitle from '../../container/MainTitle'
import Btn from '../../container/Btn'
import Items from './Items';

class Popular extends Component {
    constructor() {
        super();
        this.maintitle = {
            first: "live stream",
            name: "most popular"
        }
    }
    generateItems(i) {
        return <Items title={this.item.profile[i]} img={this.item.img[i]} title={this.item.title[i]}/>
    }
    render() {
        return (
            <section className='popular bg-darkAlt rounded-5 p-4 w-100'>
                <MainTitle first={this.maintitle.first}>{this.maintitle.name}</MainTitle>
                <div className='items d-flex justify-content-between align-items-center gap-2'>

                </div>
                <Btn name="load more streams"/>
            </section>
        )
    }
}

export default Popular;
